import React, { useEffect, useState } from "react";


function LoginPage() {
    return (
        <div className="LoginPage">
            <br />
            <InputId />
            <br />
            <InputPasswd />
            <br />
            <LoginButton />
            <br />
        </div>
    );
}

function InputId(){
    return(
        <div className="InputId">
            id (email) : <input id='inputId' type='email'></input>
        </div>
    );
}

function InputPasswd(){
    return(
        <div>
            password : <input id='inputPasswd' type='password'></input>
        </div>
    );
}

// 버튼 구성 
function LoginButton(){
    let [ btnName, setBtnName ] = useState(['Login', 'Sign up'])
    return(
        <div>
            <button type='button' >{ btnName[0] }</button>&nbsp;&nbsp;&nbsp;&nbsp;
            <button type='button' >{ btnName[1] }</button>
        </div>
    );
}


export default LoginPage;
